/*
饿了么

签到，吃货豆任务，现金提款机，笔笔返，抢10元券
目前会保持豆子数量在200+，不会放出所有隐藏任务
兼容elmCookie或elmck变量，重写会默认填写到elmCookie
多账号会并发做任务

捉包把饿了么域名包里的Cookie填到elmCookie里
多账号换行或&隔开

CK可以填全部或者只填SID和cookie2，建议USERID也填上方便更新CK。圈X目前无法自动刷新token，必须填全ck，而且失效很快
建议格式:
export elmCookie="SID=xxxxxxxx; cookie2=yyyyyyy; USERID=12345678;"

需要抢10元券的号请在对应账号ck后面加上 grabCoupon=1; ，否则默认不抢
如：export elmCookie="SID=xxxxxxxx; cookie2=yyyyyyy; USERID=12345678; grabCoupon=1;"

抢券时间默认为9点59分59秒200毫秒开始，需要改的话自己设置变量elmCouponTime
如：export elmCouponTime="9:59:59:700"

定时每天一两次就行，早上7点后务必跑一次去瓜分提款机现金

重写: 打开支付宝-饿了么小程序
[task_local]
#饿了么
58 0,9 * * * https://raw.githubusercontent.com/leafTheFish/DeathNote/main/elm.js, tag=饿了么, enabled=true
[rewrite_local]
mtop.alsc.eleme.miniapp.collection.homepagev1 url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/elm.js
[MITM]
hostname = *.ele.me

cron: 58 0,9 * * *
const $ = new Env("饿了么");
*/
